export function renderEqV2Scaling(plot1Id, plot2Id, plot3Id) {
  const el1 = document.getElementById(plot1Id);
  const el2 = document.getElementById(plot2Id);
  const el3 = document.getElementById(plot3Id);
  
  // Render Plot-1
  const layout1 = Object.assign({autosize: true}, DATA.plot1.layout || {});
  Plotly.newPlot(el1, DATA.plot1.data, layout1, {responsive: true});
  
  // Render Plot-2 & Plot-3 (empty initially)
  const layout2 = Object.assign({autosize: true}, DATA.plot2.layout || {});
  const layout3 = Object.assign({autosize: true}, DATA.plot3.layout || {});
  Plotly.newPlot(el2, [], layout2, {responsive: true});
  Plotly.newPlot(el3, [], layout3, {responsive: true});
  
  // Handle resize
  window.addEventListener('resize', () => {
    Plotly.Plots.resize(el1);
    Plotly.Plots.resize(el2);
    Plotly.Plots.resize(el3);
  });
  
  // Click handler
  el1.on('plotly_click', function(eventData) {
    const point = eventData.points[0];
    const customdata = point.customdata;
    const filename = customdata.experiment;
    const dsSize = customdata.dataset_size;
    
    // Get runs for this dataset size
    const runs = DATA.experimentData[filename][dsSize.toString()] || [];
    
    const trainTraces = [];
    const valTraces = [];
    
    runs.forEach(run => {
      const numParams = run.config.num_params;
      const losses = run.losses;
      
      // Extract and sort by step
      const entries = Object.entries(losses).map(([step, vals]) => ({
        step: parseInt(step),
        trainLoss: vals.train_loss || null,
        valLoss: vals.val_loss
      }));
      entries.sort((a, b) => a.step - b.step);
      
      // Build traces
      const trainSteps = entries.filter(e => e.trainLoss !== null).map(e => e.step);
      const trainLosses = entries.filter(e => e.trainLoss !== null).map(e => e.trainLoss);
      const valSteps = entries.map(e => e.step);
      const valLosses = entries.map(e => e.valLoss);
      
      trainTraces.push({
        x: trainSteps,
        y: trainLosses,
        mode: 'lines+markers',
        name: `${numParams} params`
      });
      
      valTraces.push({
        x: valSteps,
        y: valLosses,
        mode: 'lines+markers',
        name: `${numParams} params`
      });
    });
    
    // Update plots
    const layout2Updated = Object.assign({}, layout2, {
      title: `Train Loss Curves for Dataset Size = ${Math.round(dsSize)}<br>(${filename})`
    });
    const layout3Updated = Object.assign({}, layout3, {
      title: `Val Loss Curves for Dataset Size = ${Math.round(dsSize)}<br>(${filename})`
    });
    
    Plotly.react(el2, trainTraces, layout2Updated);
    Plotly.react(el3, valTraces, layout3Updated);
  });
}
